import React from 'react';

function bomdia(props) {
    return (
        <React.Fragment>
            <h1>Bom dia {props.nome}</h1>
            <h2>Tudo bem ?</h2>
        </React.Fragment>
    );
}

function boanoite(props) {
    return (
        <React.Fragment>
            <h1>Bom noite {props.nome}</h1>
            <h2>Tudo bem ?</h2>
        </React.Fragment>
    );
}

export default { bomdia, boanoite };
